"   <div id=\"basicsTopicLeft\">",
"    <div id=\"topicTitle\">",
"     Patient information: Hip pain in older people (The Basics)",
"    </div>",
"    <span class=\"view\">",
"     View in",
"     <a class=\"lang\" href=\"./es-419/hip-pain-in-older-people-the-basics?source=topic_page\">",
"      Spanish",
"     </a>",
"    </span>",
"    <a class=\"contributor contributor_credentials\" href=\"./authors-and-editors/patient-information\">",
"     Written by the doctors and editors at UpToDate",
"    </a>",
"    <div id=\"topicText\">",
"     <p class=\"headingAnchor\" id=\"H473802243\">",
"      <span class=\"h1\">",
"       What causes hip pain?",
"      </span>",
"      &nbsp;&mdash;&nbsp;In people older than 50, the most common causes of hip pain are:",
"     </p>",
"     <p>",
"      <ul class=\"bullet-block\">",
"       <li>",
"        <strong>",
"         Arthritis",
"        </strong>",
"        &ndash; Arthritis is the general term for &ldquo;inflammation or damage of the joints.&rdquo; People whose hip pain is caused by arthritis usually develop pain on the side of their hip, slowly over time.",
"       </li>",
"       <li>",
"        <strong>",
"         Bursitis",
"        </strong>",
"        &ndash; There are three sacs called &ldquo;bursae&rdquo; in or near the hip (",
"        <a class=\"graphic graphic_figure graphicRef65477 \" href=\"mobipreview.htm?10/25/10640\">",
"         figure 1",
"        </a>",
"        ). These sacs are filled with fluid. They help cushion and protect the joints. &ldquo;Bursitis&rdquo; is the medical term for when one of these sacs get irritated or inflamed. People whose hip pain is caused by bursitis usually feel more pain if they lay on their side, or if someone presses against the side of their hip.",
"       </li>",
"       <li>",
"        <strong>",
"         Muscle or tendon strain",
"        </strong>",
"        &ndash; Three major muscle groups help move the hip. Overuse of these muscles, or the tendons that attach them to the bones, can lead to hip pain. Pain caused by muscle or tendon strain tends to be worse when you move the leg in one particular direction.",
"       </li>",
"       <li>",
"        <strong>",
"         Nerve problems",
"        </strong>",
"        &ndash; Lots of nerves pass by the hip. These nerves or nerves in the lower part of the spine can get pressed on or damaged and cause hip pain. People with pain caused by nerve problems also often feel tingling or numbness in the area. A pinched nerve in the spine could cause other problems, such as weakness in the leg.",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H473802250\">",
"      <span class=\"h1\">",
"       Should I see a doctor or nurse for my hip pain?",
"      </span>",
"      &nbsp;&mdash;&nbsp;See a doctor or nurse right away if:",
"     </p>",
"     <p>",
"      <ul class=\"bullet-block\">",
"       <li>",
"        Your pain is sudden and severe, prevents you from putting weight on that side, or is so bad that you can&rsquo;t rotate your leg to the side. Some people who have hip pain actually have a broken hip bone. This is especially likely after a fall or even a mild impact. Having a broken hip is serious and needs immediate medical attention.",
"       </li>",
"       <li>",
"        Your hip is swollen, bruised, or bleeding",
"       </li>",
"       <li>",
"        You also have a fever along with your hip pain",
"       </li>",
"       <li>",
"        You have weakness in one of your legs or feet",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H473802257\">",
"      <span class=\"h1\">",
"       How is hip pain treated?",
"      </span>",
"      &nbsp;&mdash;&nbsp;The right treatment for hip pain depends on what is causing it. In general, treatments might include:",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        Taking medicines to reduce pain and inflammation.",
"       </li>",
"       <li>",
"        Getting a shot of a medicine called a steroid, which can reduce inflammation (these steroids are not the same ones athletes take to build up muscle)",
"       </li>",
"       <li>",
"        Physical therapy or exercises recommended by the doctor",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      If you have severe hip arthritis, your doctor or nurse might suggest surgery to replace the hip.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H473802264\">",
"      <span class=\"h1\">",
"       Is there anything I can do on my own to feel better?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Yes. Here are some things you can try:",
"     </p>",
"     <p>",
"      <ul class=\"bullet-block\">",
"       <li>",
"        Ask your doctor if there are stretches or exercises that can help with the cause of your pain. Before you do these exercises, warm up your muscles by taking a warm shower or bath.",
"       </li>",
"       <li>",
"        Consider taking non-prescription pain medicines, such as",
"        <a class=\"drug drug_patient\" href=\"mobipreview.htm?19/35/20021?source=see_link\">",
"         acetaminophen",
"        </a>",
"        (sold as Tylenol&reg;) or",
"        <a class=\"drug drug_patient\" href=\"mobipreview.htm?43/35/44597?source=see_link\">",
"         naproxen",
"        </a>",
"        (sold as Aleve&reg;). But if you have heart disease or other health problems, or if you are on prescription medicines, ask your doctor before you start taking any new medicines.",
"       </li>",
"       <li>",
"        Use a cane, walker, shoe insert, or other device, if it helps you",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H473802271\">",
"      <span class=\"h1\">",
"       More on this topic",
"      </span>",
