var title_f42_25_43416="FGS EM";
var content_f42_25_43416=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=NEPH%2F79479&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=3\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=NEPH%2F79479&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=3\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic2\" style=\"width: 1040px;\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Focal glomerulosclerosis",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 378px; height: 243px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Electron micrograph in focal segmental glomerulosclerosis shows diffuse epithelial cell foot process fusion with occasional loss of the epithelial cells (arrows). The other major finding is massive subendothelial hyaline deposits (Hy) under the glomerular basement membrane (GBM). These deposits reflect insudation of plasma proteins, not the deposition of immunoglobulins. These deposits contribute to narrowing of the capillary lumens.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Courtesy of Helmut Rennke, MD.",
"    </div>",
"   </div>",
"  </div>",
"  <div class=\"figure\" style=\"width: 450px\">",
"   <div class=\"ttl\">",
"    Electron micrograph of a normal glomerulus",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 377px; height: 266px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Electron micrograph of a normal glomerular capillary loop showing the fenestrated endothelial cell (Endo), the glomerular basement membrane (GBM), and the epithelial cells with its interdigitating foot processes (arrow). The GBM is thin, and no electron dense deposits are present. Two normal platelets are seen in the capillary lumen.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Courtesy of Helmut Rennke, MD.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
