var title_f42_25_43419="Characteristics of stroke subtypes";
var content_f42_25_43419=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=NEURO%2F69907&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=NEURO%2F69907&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Characteristics of stroke subtypes",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\">",
"        Stroke type",
"       </td>",
"       <td class=\"subtitle1\">",
"        Clinical course",
"       </td>",
"       <td class=\"subtitle1\">",
"        Risk factors",
"       </td>",
"       <td class=\"subtitle1\">",
"        Other clues",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Intracerebral hemorrhage",
"       </td>",
"       <td>",
"        Gradual progression during minutes or hours",
"       </td>",
"       <td>",
"        Hypertension, trauma, bleeding diatheses, illicit drugs (eg, amphetamines, cocaine), vascular malformations. More common in blacks and Asians than in whites.",
"       </td>",
"       <td>",
"        May be precipitated by sex or other physical activity. Patient may have reduced alertness.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Subarachnoid hemorrhage",
"       </td>",
"       <td>",
"        Abrupt onset of sudden, severe headache. Focal brain dysfunction less common than with other types.",
"       </td>",
"       <td>",
"        Smoking, hypertension,&nbsp;moderate to heavy alcohol use, genetic susceptibility (eg, polycystic kidney disease,&nbsp;family history of subarachnoid hemorrhage) and sympathomimetic drugs (eg, cocaine)",
"       </td>",
"       <td>",
"        May be precipitated by sex or other physical activity. Patient may have reduced alertness.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Ischemic (thrombotic)",
"       </td>",
"       <td>",
"        Stuttering progression with periods of improvement. Lacunes develop over hours or at most a few days; large artery ischemia may evolve over longer periods.",
"       </td>",
"       <td>",
"        Atherosclerotic risk factors (age, smoking, diabetes mellitus, etc.). Men affected more commonly than women. May have history of TIA.",
"       </td>",
"       <td>",
"        May have neck bruit.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Ischemic (embolic)",
"       </td>",
"       <td>",
"        Sudden onset with deficit maximal at onset. Clinical findings may improve quickly.",
"       </td>",
"       <td>",
"        Atherosclerotic risk factors as listed above. Men affected more commonly than women. History of heart disease (valvular, atrial fibrillation, endocarditis).",
"       </td>",
"       <td>",
"        Can be precipitated by getting up at night to urinate, or sudden coughing or sneezing.",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
